description:
The Weekenders is a Disney animated series about the weekend life of four diverse 7th graders: Tino Tonitini, Lorraine (&quot;Lor&quot;) McQuarrie, Carver Descartes, and Petratishkovna (&quot;Tish&quot;) Katsufrakis, voiced by veteran cartoon voice-actors: Jason Marsden, Grey DeLisle, Phil LaMarr, and Kath Soucie, respectively. It is stated at least once that the four main characters are each twelve years old.[1] The setting is the fictional town of Bahia Bay, California. The show was created by Doug Langdale, later creator of Disney Channel's Dave the Barbarian.

